INSERT INTO "Einsatz" VALUES (3,1,'%Nachname%, Guten Morgen. Ich brauche dringend ihre Hilfe.. Ich habe so starke Bauchschmerzen!','2012-12-25 23:00:00',20,70,1,6,13,-30,50,4,'Patient bitte noch zufügen. Ansonsten .... guuuut :)',851,1,0);
INSERT INTO "Einsatz" VALUES (4,32,'Hallo mein Name ist %NACHNAME%. Hier liegt jemand vor meinem Haus auf der Straße und rührt sich kaum.','2012-12-25 23:00:00',14,80,1,22,6,-50,50,539,'',NULL,1,0);
INSERT INTO "Einsatz" VALUES (5,29,'Hallo, hallo hier ist gerade ein Auto von der Straße abgekommen und hat sich überschlagen.','2012-12-25 23:00:00',18,127,1,1,25,-50,50,248,'bitte Spezielle Fragen ausfüllen! Peter (erledigt?)',248,2,0);
INSERT INTO "Einsatz" VALUES (6,9,'Hallo, hallo..........! Hilfe mein Mann liegt hier im Flur......Hilfe er liegt da und sagt nichts....bitte Schnell ! Kommen Sie !','2012-12-25 23:00:00',70,95,1,1,25,-20,40,258,'',NULL,1,0);
INSERT INTO "Einsatz" VALUES (7,10,'Ich hab plötzlich so einen Druck auf der Brust. Hoffentlich nicht wieder ein Infarkt.','2012-12-25 23:00:00',30,100,1,1,25,-50,50,268,'',NULL,1,0);
INSERT INTO "Einsatz" VALUES (8,10,'Hallo, ich hab starke Schmerzen im Herz und ich kann schlecht atmen. Kommen Sie bitte!','2012-12-25 23:00:00',60,80,1,1,25,-50,50,258,'',10,3,0);
INSERT INTO "Einsatz" VALUES (9,30,'Ja, hallo %NACHNAME% mein Name, mir ist etwas ganz dummes passiert. Ich bin eben beim Wandern auf einer Wurzel ausgerutscht. Nun tut mein Fuß so weh, er ist auch schon angeschwollen, können Sie da mal jemanden schicken?','2012-12-25 23:00:00',30,127,1,9,19,-50,50,248,'Einsatz Okay :). Wetter noch hinzugefügt',10,3,0);
INSERT INTO "Einsatz" VALUES (10,13,'Mein Bruder ist Diabetiker und er ist kaum ansprechbar. Hab jetzt mal messen wollen, aber das Gerät zeigt immer nur LOW an.','2012-12-25 23:00:00',15,100,1,1,25,-50,50,268,'',10,3,0);
INSERT INTO "Einsatz" VALUES (11,29,'Hallo, Hallo hier gab es ein Unfall ein Auto hat sich hier überschlagen, kommen sie Schnell!','2012-12-25 23:00:00',0,127,1,2,5,-50,50,258,'passende Diagnose fehlt',NULL,1,0);
INSERT INTO "Einsatz" VALUES (12,10,'Hallo hören sie mich ? Ich habe auf einmal so plötzlich starke Herzschmerzen !','2012-12-25 23:00:00',30,127,1,6,9,-50,50,258,'',NULL,1,0);
INSERT INTO "Einsatz" VALUES (13,32,'Hallo, hier ist %NACHNAME% von %POI%, wir haben hier ein Gast der zu tief ins Glas geschaut hat.','2012-12-25 23:00:00',18,80,1,23,6,-50,50,248,'Alter auf max. 80 gesetzt. \r\nBitte nach den Sätzen ein Punkt setzen. \r\nGruß Kevin\r\n\r\nHallo Daniel. Nach überfliegen sind mir noch ein paar Rechtschreibfehler aufgefallen. Diese bitte noch korrigieren ;).\r\n\r\nWurde verbessert.\r\nCandyman',630,2,0);
INSERT INTO "Einsatz" VALUES (14,9,'Guten Tag Junger Mann, tut mir leid das ich Sie belästigen muss, aber mein Mann kam vor ca. 2 Stunden vom Schnee schippen rein und hat sich gleich auf das Sofa gelegt, als ich eben nach ihm gesehen habe, hat er mir keine Antwort mehr gegeben. Was soll ich nun machen?','2012-12-25 23:00:00',90,127,1,1,25,-50,50,248,'',248,2,0);
INSERT INTO "Einsatz" VALUES (15,3,'Hallo? Mein Name ist %NACHNAME% . Mein Kind hat eben mit dem Hund gespielt und der hat dann zugeschnappt. Das blutet jetzt wie verrückt und das Kind schreit.','2012-12-25 23:00:00',0,18,1,16,23,-50,50,268,'passende Diagnose fehlt',NULL,1,0);
INSERT INTO "Einsatz" VALUES (16,28,'Kommen Sie mal bitte vorbei? Oma geht es nicht so gut. Irgend etwas stimmt nicht mit ihr und wir bekommen sie nicht ins Auto um zum Arzt zu fahren.','2012-12-25 23:00:00',65,110,1,1,25,-50,50,268,'',NULL,1,0);
INSERT INTO "Einsatz" VALUES (17,6,'Ja hallo, Schwester %VORNAME% hier. Die Frau %NACHNAME% brodelt seit geraumer Zeit und bekommt kaum Luft. Der Kassenarzt meinte ich soll die 112 anrufen.','2012-12-25 23:00:00',65,120,1,1,25,-50,50,268,'',NULL,1,0);
INSERT INTO "Einsatz" VALUES (18,30,'Guten Tag, %NACHNAME% mein Name. Können Sie mal bitte lang kommen? Meine Kniescheibe ist wieder raus. Ich werd noch verrückt mit diesem Knie.','2012-12-25 23:00:00',18,70,1,8,23,-50,50,268,'',10,3,0);
INSERT INTO "Einsatz" VALUES (19,6,'Ha...haallooo....*keuch* Ich bekomme irgendwie *hust* ganz schwer Luft....','2012-12-25 23:00:00',18,90,1,1,25,-50,50,851,'Wetter hinzugefügt. \r\nGruß Kevin',851,2,0);
INSERT INTO "Einsatz" VALUES (20,6,'Guten Tag, ich bekomme schlecht Luft. Ist bei mir bekannt, aber Heute ist das mit der Luft schlechter, würden Sie jemanden schicken?','2012-12-25 23:00:00',60,70,1,1,25,-50,50,258,'Allgemeine Fragen bitte vollständig ausfüllen. Spezielle Fragen noch ausführlicher... Vor allem auch bitte bei Ort und Richtung.\r\n\r\nGruß sonnico112',851,1,0);
INSERT INTO "Einsatz" VALUES (21,23,'Ja hier ist %NACHNAME%. Ich hab vorhin ein paar Tabletten genommen. Jetzt hab ich sehr starke Bauchschmerzen und mir ist ganz schlecht....','2012-12-25 23:00:00',15,45,1,1,25,-50,50,851,'Wetter hinzugefügt',851,2,0);
INSERT INTO "Einsatz" VALUES (22,31,'Guten Tag! Mein Name ist %NACHNAME%, Ich bin Lehrerin am %POI%. In meinem Sportunterricht ist beim warmlaufen gerade eine Schülerin zusammengebrochen!','2012-12-25 23:00:00',10,20,2,9,17,-50,50,197,'Div. Fragen hinzugefügt.\r\nGruß Kevin \r\nDiagnosse Hinzugefügt....Gruß Daniel',851,3,0);
INSERT INTO "Einsatz" VALUES (23,17,'Hilfe, ich blute am Kopf, hilfe, ich weiß gar nicht, was genau passiert ist! Kommen Sie, ich habe solche Angst !','2012-12-25 23:00:00',50,80,1,1,25,-50,50,258,'',NULL,1,0);
INSERT INTO "Einsatz" VALUES (24,10,'Hier ist %VORNAME% %NAME%.... mein Vater hat auf einmal so Schmerzen im Bereich des Armes....','2012-12-25 23:00:00',20,100,1,1,25,-50,50,851,'',851,2,0);
INSERT INTO "Einsatz" VALUES (25,6,'Haa........llo....koo....mmen sie b...iiitttee... keine... Lu....ft..Hilfe,...H......il.....feeee','2012-12-25 23:00:00',20,50,1,1,25,-50,50,258,'',NULL,1,0);
INSERT INTO "Einsatz" VALUES (26,12,'Hallo! Kommen Sie bitte schnell, meine Name ist %VORNAME% %NACHNAME%, mein Sohn zuckt so komisch!','2012-12-25 23:00:00',0,5,1,1,25,-50,50,197,'Bitte Rechtschreibung anpassen. \r\nBitte beachte, dass Anreden wie Sie und Ihnen groß geschrieben werden.\r\nAußerdem ein paar Fragen hinzufügen.\r\nGruß Kevin',10,3,0);
INSERT INTO "Einsatz" VALUES (27,28,'Hallo hier ist %VORNAME%. Mein Opa sitzt seit einiger Zeit so komisch da und nuschelt nur so vor sich hin....','2012-12-25 23:00:00',15,100,1,1,25,-50,50,851,'Wetter hinzugefügt.\r\nLG Kevin\r\nHauptgruppe verbessert von Kopfschmerzen auf Schlaganfall',4,2,0);
