INSERT INTO "Einsatz" VALUES (285,32,'Hallo, %Name% mein Name, Notfallzentrale der Deutschen Bahn. Unser Warnsystem meldet gerade dass beim ICE 67 die Notbremse betätigt wurde, wir haben im Moment allerdings keinen Kontakt zum Triebfahrzeugführer, ich hab daraufhin beim Zugbegleiter angerufen, der meinte nur \"Unfall mit Personenschaden\", was soviel heißt wie Suizid. Naja also wir haben ja sowas nicht selten, der Zugführer sitzt wie meistens wie gelähmt in seinem Führerstand und braucht schleunigst nen Arzt. Laut Zugbegleiter sind alle Insassen wohl auf, müssen halt irgendwo untergebracht werden, da der Zug nicht mehr fahrbereit ist, aber wir organisieren das schon.','2013-12-06 08:55:58',0,0,1,6,3,-50,50,1618,'Anaphylaktischer Schock? stimmt das so? \r\n- ja, dann eben nur \"Schock\" :-)\r\n\r\nSehr schöner Einsatz. LG Kevin',248,3,0);
