INSERT INTO "Einsatz" VALUES (538,12,'Krampfanfall, männlich, 50, bei Bewusstsein.Auf den folgenden Seiten sind Meldungen über die Einsätze mehrerer Freiwilliger Feuerwehren aus dem Landkreis Diepholz aufgeführt.\r\n\r\n Hinter der Seite www.einsatzmeldungen.de steht dabei die Idee, das Einsatzgeschehen übergreifend darzustellen und auch die enge Zusammenarbeit der einzelnen Ortsfeuerwehren im Rahmen der \"Nachbarschaftlichen Löschhilfe und Hilfeleistung\" aufzuzeigen.\r\n\r\nZum jeweiligen Einsatz finden Sie einen Verweis auf die Internetpräsenzen der einzelnen Ortsfeuerwehren. Auf diesen erhalten Sie dann genauere Informationen zum Einsatzgeschehen wie z. B. der Einsatzdauer, zu den eingesetzten Kräften und vieles mehr. Zahlreiche Informationen rund ums das Feuerwehrwesen ergänzen die Internetauftritte.\r\n\r\nDie Feuerwehren folgender Gemeinden und Städte sind aktuell aufgeführt:\r\nBarnstorf, Diepholz, Lemförde, Rehden, Sulingen und Twistringen.\r\n\r\nZum Anzeigen der Meldungen können Sie über die linke Spalte gehen aber auch die Suchfunktion in der oberen Leiste nutzen. Hierbei lassen sich gezielt Informationen finden, die in den Überschriften oder Texten enthalten sind. (z. B. Sturm, Brand, Unfall, usw.).\r\n\r\nWenn Sie im Kalender die blau hinterlegten Tage anwählen, erhalten Sie die Einsätze für den entspr. Tag. \r\n\r\nWeiteren Fragen aber auch gerne Anregungen können gerne über das Feld \"Kontakt\" an das Team von www.einsatzmeldungen.de eingereicht werden.\r\n\r\nWenn auch Ihre Einsätze dargestellt werden sollen, benutzen Sie bitte ebenfalls das Feld \"Kontakt\".','2015-03-07 06:15:31',0,0,4,9,10,-50,50,2339,'dgvbdgvb',NULL,1,0);
